import BurgerBuilder from "../../containers/BurgerBuilder/BurgerBuilder";
import Navbar from "../Navbar/Navbar";
import { BrowserRouter } from "react-router-dom";
import "./Layout.css";

const Layout = () => {
  return (
    <BrowserRouter>
      <div className="Layout">
        <Navbar />
        <BurgerBuilder />
      </div>
    </BrowserRouter>
  );
};

export default Layout;
